import React from 'react';
import ReactDOM from 'react-dom';

class MyMain extends React.Component{
constructor(props){
    super(props);

}
render(){
    return(
<div>
            <h1>Il nostro menu'</h1>
            <ul>
                <li>{['pasta','pane','patate','olio']}</li>
            </ul>
        </div> );
}

}
export default MyMain;
